import React, { useState } from "react";
import "./modalDetailEvent.css";
import "./modalLogin.css";
import TextField from "../ui/TextField";
import Button from "../ui/Button";
import axios from "axios";

localStorage.setItem("changepassSuccess", true);

const removeErrMsg = () => {
  document.querySelectorAll("#errmsg")?.forEach((e) => e.remove());
};

function ModalCreateEvent({ isOpen, onClose, ...other }) {
  const [form, setForm] = useState({
    passold: "",
    passnew: "",
    cfpassnew: "",
  });

  const handleOnChange = (key, value) => {
    removeErrMsg();
    setForm({
      ...form,
      [key]: value,
    });
  };

  const handleChangePass = async () => {
    // if (form.cfpassnew !== form.passnew) {
    //   localStorage.setItem("changepassSuccess", false);
    // } else {
    //   try {
    //     await axios
    //       .put(
    //         "http://localhost:8000/api/v1/users/change_password/",
    //         {
    //           password: form.passold,
    //           new_password: form.passnew,
    //         },
    //         {
    //           headers: {
    //             Authorization: "Bearer " + localStorage.getItem("token"),
    //           },
    //         }
    //       )
    //       .then((res) => {
    //         if (res?.statusText === "OK") {
    //           localStorage.setItem("changepassSuccess", true);
    //           window.location.reload();
    //           localStorage.removeItem("changepassSuccess");
    //         } else {
    //           localStorage.setItem("changepassSuccess", false);
    //         }
    //       });
    //   } catch (error) {
    //     localStorage.setItem("changepassSuccess", false);
    //   }
    // }
  };

  return (
    <div className="modal-overlay">
      <div className="modal modal-login">
        <button className="modal-close" onClick={onClose}>
          &times;
        </button>
        <div className="modal-content">
          <h1>Tạo sự kiện</h1>
          <div className="form-login" id="form">
          <div className="flex-input">
          <div className="item-form">
            <TextField
              title={"Họ và tên"}
              value={profile.name}
              flexRow
              onChange={(e) => onChangeText("name", e.target.value)}
            />
            <TextField
              title={"Giới tính (Nam/Nữ)"}
              value={profile.gender}
              flexRow
              onChange={(e) => onChangeText("gender", e.target.value)}
            />
            <TextField
              title={"Date of birth"}
              value={profile.dateOfBirth}
              flexRow
              onChange={(e) => onChangeText("dateOfBirth", e.target.value)}
            />
            <TextField
              title={"Email"}
              value={profile.email}
              flexRow
              onChange={(e) => onChangeText("email", e.target.value)}
            />
          </div>
          <div className="item-form">
            <TextField
              title={"Tên đăng nhập"}
              value={profile.nameLogin}
              flexRow
              onChange={(e) => onChangeText("nameLogin", e.target.value)}
            />
            <TextField
              title={"Mật khẩu"}
              value={profile.password}
              flexRow
              type="password"
              onChange={(e) => onChangeText("password", e.target.value)}
            />
            <Button
              title={"Đổi mật khẩu "}
              type={"link"}
              styles={{
                textAlign: "right",
              }}
              onClick={() => setIsOpen(true)}
            />
            <TextField
              title={"Số điện thoại"}
              value={profile.phone}
              flexRow
              onChange={(e) => onChangeText("phone", e.target.value)}
            />
          </div>
        </div>
          </div>
          <div className="form-action-change-pass">
            <Button
              title={"Tạo"}
              type={"button"}
              styles={{
                backgroundColor: "#409FC8",
                color: "#fff",
                borderRadius: "10px",
              }}
              onClick={async () => await handleChangePass()}
            />
            <Button
              title={"Hủy"}
              styles={{
                backgroundColor: "transparent",
                color: "#000",
                border: "1px solid",
                borderRadius: "10px",
              }}
              type={"button"}
              onClick={onClose}
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default ModalCreateEvent;
